import React, { Component } from "react";

class Door extends Component {
  state = {
    id: 1,
    detail: {},
  };
  render() {
    return (
      <div>
        <p>{this.state.name}</p>
        <table className="table">
          <thead>
            <tr>
              <th>S.No</th>
              <th>Name</th>
              <th>Address</th>
              <th>Time</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {doors.map((d, index) => (
              <tr key={d.id + d.name}>
                <th>{index + 1}</th>
                <th>{d.name}</th>
                <th>{d.address}</th>
                <th>{d.dateTime}</th>

                <th>
                  <Link to={`/door/${d.id}`}>Detail</Link>
                </th>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Door;
